import React from 'react'


export default function Options() {
    return (
        <div>
            <p>
                {<input type="checkbox" />}
                First
            </p>
            <p>
                {<input type="checkbox" />}
                Second
            </p>
            <p>
                {<input type="checkbox" />}
                Third
            </p>
            <p>
                {<input type="checkbox" />}
                Fourth
            </p>
        </div>
    );
}

